CREATE OR REPLACE VIEW views.fail_shedule AS
 SELECT dop.description,
    ets.start_date_time,
    r.id_route,
    r.number_route,
    r.code_route,
    r.title
   FROM ((public.exit_transport_schedule ets
     RIGHT JOIN ( SELECT eets.id_exit_transport_shedule,
            max((eets.description)::text) AS description
           FROM public.edit_exit_transport_schedule eets
          GROUP BY eets.id_exit_transport_shedule) dop ON ((dop.id_exit_transport_shedule = ets.id_exit_transport_shedule)))
     LEFT JOIN public.route r ON ((r.id_route = ets.id_transport_in_route)))
  GROUP BY ets.start_date_time, ets.id_transport_in_route, r.id_route, dop.description;


--
-- TOC entry 4909 (class 2618 OID 19336)
-- Name: detal_info_route_operator _RETURN; Type: RULE; Schema: views; Owner: postgres
--

CREATE OR REPLACE VIEW views.detal_info_route_operator AS
 SELECT r.number_route,
    r.code_route,
    r.title,
    string_agg(((ts.title)::character varying)::text, ' - '::text) AS line_stop,
    public.st_length(public.st_makeline(ts.point)) AS length_route,
    public.st_makeline(ts.point) AS polyline_route
   FROM ((public.route r
     LEFT JOIN ( SELECT route_in_stop.id_route_in_stop,
            route_in_stop.id_transport_stop,
            route_in_stop.id_route,
            route_in_stop.number_stop,
            route_in_stop.min_travel_time
           FROM public.route_in_stop
          ORDER BY route_in_stop.id_route, route_in_stop.number_stop) ris ON ((ris.id_route = r.id_route)))
     JOIN public.transport_stop ts ON ((ris.id_transport_stop = ts.id_transport_stop)))
  WHERE (r.id_route IN ( SELECT tir.id_route
           FROM public.transport_in_route tir
          WHERE (tir.is_operator = true)))
  GROUP BY r.id_route;


